import React from "react";
import {
  Text,
  Accordion,
  Center,
} from "@mantine/core";

const HomeSlider = () => {
  return (
    <Accordion.Item value="slider">
    <Accordion.Control bg="indigo.2">
      <Center>
        <Text fw={700}>Slider</Text>
      </Center>
    </Accordion.Control>
    <Accordion.Panel>
      Content
    </Accordion.Panel>
  </Accordion.Item>
  );
};

export default HomeSlider;
